import React, { useEffect, useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import { toast } from "react-toastify";
import Aos from "aos";
import "aos/dist/aos.css";

// Importing icons from react-icons
import { BiDashboard, BiLogOut } from "react-icons/bi";
import { MdOutlineWatchLater } from "react-icons/md";
import { AiOutlineSchedule, AiOutlineBarChart } from "react-icons/ai";
import { IoCalendarNumberOutline } from "react-icons/io5";
import { BsListCheck } from "react-icons/bs";

import DarkMode from "./DarkMode/Darkmode";
import Notification from "./Notification/Notification";
import { IoMdNotifications } from "react-icons/io";
import axios from "axios";
import icon from "../utils/icon.PNG";

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const [user, setUser] = useState();
  const [upcomingTasks, setUpcomingTasks] = useState([]);
  const [dialog, setDialog] = useState({
    isLoading: false,
  });

  useEffect(() => {
    Aos.init({ duration: 800 });
    axios.get(`${process.env.REACT_APP_API_URL}/getUser`)
      .then(res => {
        setUser(res.data);
      })
      .catch(err => console.log(err));

    axios.get(`${process.env.REACT_APP_API_URL}/task/getTask`)
      .then(res => {
        let temp = res.data.filter(
          obj => obj.done === false && obj.task.deadline === new Date().toISOString().split("T")[0]
        );
        setUpcomingTasks(temp);
      })
      .catch(err => console.log(err));
  }, []);

  const openNotifi = () => {
    setDialog({ isLoading: true });
  };

  const closeNotifi = () => {
    setDialog({ isLoading: false });
  };

  function logOut() {
    toast.success("Logged out successfully (mock)");
    navigate("/");
  }

  const navItems = [
    { path: "/Home", label: "Dashboard", icon: <BiDashboard size={22} color="white" /> },
    { path: "/Home/projects", label: "Project", icon: <BsListCheck size={20} color="white" /> },
    { path: "/Home/focus", label: "Focus", icon: <MdOutlineWatchLater size={20} color="white" /> },
    { path: "/Home/timetable", label: "TimeTable", icon: <AiOutlineSchedule size={20} color="white" /> },
    { path: "/Home/calendar", label: "Calendar", icon: <IoCalendarNumberOutline size={20} color="white" /> },
    { path: "/Home/report", label: "Report", icon: <AiOutlineBarChart size={20} color="white" /> },
  ];

  return (
    <nav className="nav-left" data-aos="fade-right">
      <button className="todo-theme">
        <img src={icon} alt="" />
      </button>
      <DarkMode />
      <button className={`${upcomingTasks.length ? " bell" : ""}`} onClick={openNotifi}>
        <span id="noti-count">{upcomingTasks.length}</span>
        <IoMdNotifications size={25} color="#3081D0" />
      </button>
      <img
        title={user && `${user.userName}`}
        id="prof-img"
        src={user && `${user.picUrl}`}
        alt=""
      />
      {dialog.isLoading && <Notification closeNotifi={closeNotifi} upcomingTasks={upcomingTasks} />}
      {navItems.map((item) => (
        <button key={item.path} onClick={() => navigate(item.path)} className={`nav-icon ${location.pathname === item.path ? "active" : ""}`}>
          {item.icon}
        </button>
      ))}
      <button className="nav-icon" onClick={logOut}>
        <BiLogOut size={22} color="white" />
      </button>
    </nav>
  );
};

export default Navbar;
